import React, { Component } from 'react';
import InfoCard from '../../componentes/InfoCard/InfoCard'
import classes from '../inicioResidente/inicioResidente.css'
import ButtonS from '../../componentes/ButtonStyle/ButtonStyle'
import {
    Link
} from "react-router-dom";

class inicioResidente extends Component {

    render() {
        return (
            <div className={classes['body']}>
                <InfoCard></InfoCard>
                <div className={classes['buttons']}>
                    <Link to='/'>
                        <ButtonS name='Cerrar Sesion'></ButtonS>
                    </Link>
                    <Link>
                        <ButtonS name='Foro Residencial'></ButtonS>
                    </Link>
                    <Link>
                        <ButtonS name='Pago Administracion'></ButtonS>
                    </Link>
                </div>
            </div>
        )
    }

}
export default inicioResidente
